warranty Notebook Service&lt;/li&gt;  &lt;li&gt;Doba pokrytí (v měsících): 36&lt;/li&gt;  &lt;/ul&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;div class='row'&gt;  &lt;div class='desc'&gt;  &lt;h2&gt;Vyberte správný Care Pack pro Vaše zařízení&lt;/h2&gt;  &lt;p&gt;Pro ověření kompatibility HP Care Pack s Vašim zařízením, prosím, přejděte na: &lt;a href='https://cpc.ext.hp.com/portal/site/cpc/' target='_blank'&gt;HP Care Pack Central&lt;/a&gt;&lt;/p&gt;  &lt;p&gt;Do pole 'Najít produkt' vložte Part No. Vašeho zařázení bez lokace (př. 53L90EA).&lt;/p&gt;  &lt;p&gt;V horní části vyberte v roletce 'Zadejte zemi/oblast' zemi (CZ či SK).&lt;/p&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;div class='row'&gt;  &lt;div class='desc'&gt;  &lt;h2&gt;Vyskytl se nějaký problém při registraci?&lt;/h2&gt;  &lt;p&gt;Pokud máte jakýkoliv problém s registrací zakoupeného HP Care Pack, kontaktujte, prosím, přimárně HP Care Pack Team na emailové adrese &lt;a href='mailto:carepackcz@hp.com'&gt;carepackcz@hp.com&lt;/a&gt; (platí pro Českou republiku) nebo &lt;a href='mailto:slovakia.carepack@hp.com'&gt;slovakia.carepack@hp.com&lt;/a&gt; (platí pro Slovesnkou republiku).&lt;/p&gt;  &lt;p&gt;V záložce 'Ke stažení' na této produktové kartě je vložen soubor s nejčastěji se vyskytovanými chybami při registraci HP Care Pack, případně při práci v HP CSN systému.&lt;/p&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;div class='row'&gt;  &lt;div class='desc'&gt;  &lt;h2&gt;Doba trvání a pravidla pořizování služeb HP Care Pack&lt;/h2&gt;  &lt;p&gt;Balíček HP Care Pack rozšiřující záruku lze přikoupit do 90 dnů od data nákupu produktu.&lt;br /&gt; Balíček HP Care Pack je nutné do 10 dnů od zakoupení zaregistrovat, abyste mohli využívat jeho výhod.&lt;br /&gt; Služba začíná platit datem nákupu HW a trvá po dobu specifickou v dokumentech HP Care Pack.&lt;br /&gt; Vyzvednutí e-carepacku vyžaduje přístup do HP Channel Services Network systému (CSN).&lt;br /&gt; HP CSN systém je bezpečná internetová aplikace vytvořená pro distributory a partnery k objednávání, registraci a sledování HP Care Packů dodávaných v elektronické podobě.&lt;br /&gt; V době nákupu HW nelze nakupovat ani registrovat službu HP Care Pack současně s Post Warranty a nebo samotnou službu Post Warranty.&lt;/p&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;/div&gt;","false","0","0001004600040002","1776","-1","true","00020099","4198","-1","true","0","Měsíc(ů)","MN","0001-01-01T00:00:00","1402.00","KS","0.00","1","2009-12-16T15:58:25.117","HPC","127","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_303\/303565_0a_3.jpg'}","        <productnavigatordata>          <attributecode>136</attributecode>          <valuecode>616</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>137</attributecode>          <valuecode>621</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>138</attributecode>          <valuecode>624</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0</weight>          <length>0</length>          <width>0</width>          <height>0</height>        </productlogisticdata>      ","N","","false",""),("308496","504877","ACER prodloužení záruky na 3 roky CARRY IN, PC Veriton 2/4, Extensa (M,N,X,S,L), elektronicky","420.00","420.00","ACP","0.00","0.00","0.000000","0.000","0 Měsíc(ů)","ACER PC","420.00","602.00","21.00","SV.WPCA0.B10","false","0,00","","Acer","49119900","","ACER prodloužení záruky na 3 roky CARRY IN, PC Veriton 2/4, Extensa (M,N,X,S,L), elektronicky","Typ servisní služby:Prodloužení záruky po jejím doběhnutí; Délka servisní služby (v letech):3; Typ záruční  opravy:V servise","1","&lt;table dir='LTR' border='1' width='636' cellspacing='1' cellpadding='2'&gt;  &lt;tbody&gt;  &lt;tr&gt;  &lt;td bgcolor='#99cc00' width='22%' height='464'&gt;  &lt;p align='CENTER'&gt;NO BOOKLET&lt;/p&gt;  &lt;p align='CENTER'&gt;&lt;span style='font-family: Calibri; font-size: medium;'&gt;CARRY IN&lt;/span&gt;&lt;/p&gt;  &lt;/td&gt;  &lt;td width='78%' height='464'&gt;  &lt;p&gt;ACER prodloužení záruky na 3 roky CARRY IN, PC Veriton 2/4, Extensa (M,N,X,S,L), elektronicky&lt;/p&gt;  &lt;p align='LEFT'&gt; &lt;/p&gt;  &lt;p align='LEFT'&gt; &lt;/p&gt;  &lt;p align='LEFT'&gt;Záruku je nutné zaregistrovat do 365 dnů od prodeje produktu koncovému zákazníkovi, v opačném případě nebude prodloužená záruka akceptována.&lt;/p&gt;  &lt;p align='LEFT'&gt; &lt;/p&gt;  &lt;p align='LEFT'&gt;Služba Acer Care Plus:&lt;/p&gt;  &lt;p align='LEFT'&gt;CARRY IN - vysoce kvalitní asistenční služba v servisním centru Acer v Brně včetně dopravy do a ze servisu bez dalších poplatků. Prodlouženou záruku lze uplatnit kdekoliv v Evropské únii.&lt;/p&gt;  &lt;p align='LEFT'&gt; &lt;/p&gt;  &lt;p align='LEFT'&gt;Návod na registraci:&lt;/p&gt;  &lt;p align='LEFT'&gt;Po zakoupení prodloužené záruky obdržíte od distributora formulář, kde je třeba doplnit jméno koncového zákazníka, seriové číslo produktu a datum prodeje. Vyplněný formulář pošlete emailem do servisního střediska Acer na adresu service.brno@acer.com a po registraci prodloužené záruky dostanete na email potvrzení o registraci.&lt;/p&gt;  &lt;p align='LEFT'&gt; &lt;/p&gt;  &lt;p align='LEFT'&gt;Prodloužená záruka se nevztahuje na baterii.&lt;/p&gt;  &lt;p align='LEFT'&gt; &lt;/p&gt;  &lt;p align='LEFT'&gt;Platnost prodloužené záruky můžete ověřit v servisním centru:&lt;/p&gt;  &lt;p align='LEFT'&gt;+420 531 027 777, +421 2 3333 1027&lt;/p&gt;  &lt;p align='LEFT'&gt;www.acer.com/ac/cs/CZ/content/service-center&lt;/p&gt;  &lt;p align='LEFT'&gt; &lt;/p&gt;  &lt;/td&gt;  &lt;/tr&gt;  &lt;/tbody&gt;  &lt;/table&gt;  &lt;p&gt; &lt;/p&gt;","false","0","0001000400090007","7735","32","true","00020065","4164","-1","true","0","Měsíc(ů)","","0001-01-01T00:00:00","420.00","KS","0.00","1","2019-01-03T10:30:10.25","ACR","127","false","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_308\/308496_0a_3.jpg'}","        <productnavigatordata>          <attributecode>136</attributecode>          <valuecode>617</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>137</attributecode>          <valuecode>621</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>138</attributecode>          <valuecode>624</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0</weight>          <length>0</length>          <width>0</width>          <height>0</height>        </productlogisticdata>      ","N","","false",""),("308497","504878","ACER prodloužení záruky na 4 roky CARRY IN, PC Veriton 2/4, Extensa (M,N,X,S,L), elektronicky","803.00","803.00","ACP","0.00","0.00","0.000000","0.000","0 Měsíc(ů)","ACER PC","803.00","1132.00","21.00","SV.WPCA0.B12","false","0,00","Novinka","Acer","49119900","","ACER prodloužení záruky na 4 roky CARRY IN, PC Veriton 2/4, Extensa (M,N,X,S,L), elektronicky","Typ servisní služby:Prodloužení záruky po jejím doběhnutí; Délka servisní služby (v letech):3; Typ záruční  opravy:V servise","1","MOŽNO ZAREGISTROVAT  ZDE:http://www.aceradvantage.com/advantage/page1.do?link=ln1817&amp;UserCtxParam=0&amp;GroupCtxParam=0&amp;ctx1=cz&amp;ctx6=6&amp;ctx7=3 &lt;br&gt;  AcerAdvantage je program prodloužené záruky na výrobky Acer, který je neobyčejně úspěšný v zemích, v nichž byl zaveden. V současné době je rozšířen a nabízen ve všech zemích Evropského hospodářského společenství.    AcerAdvantage je evropský program, který lze zakoupit k výrobkům Acer, jako např. notebookům, osobním počítačům, LCD monitorům, projektorům, serverům a diskovým polím.     Nabízí tříletou prodlouženou záruku v několika variantách (v závislosti na výrobku a zvoleném typu prodloužené záruky. Další informace naleznete na webových stránkách pro příslušnou řadu výrobků), jako např.: servis v servisním středisku Acer nebo u zákazníka, různé časy odezvy od 4 hodin do 2 dnů, různé pokrytí od 5 do 7 dnů v týdnu a od 9 do 24 hodin denně, opravu v krátké lhůtě podle programu AcerAdvantage pro prioritní zákazníky a dočasnou náhradu tak, aby vždy byla zaručena nejvyšší možná dostupnost zakoupeného výrobku.   Dále vám nabízí mnoho dalších výhod, jako např. bezplatné opravy náhodných poškození pro notebooky a lhůtu opravy do pěti pracovních dnů, bezplatnou podporu prostřednictvím telefonu, faxu nebo elektronické pošty po celou dobu platnosti tříleté prodloužené záruky.     Cílem programu AcerAdvantage je přesvědčit zákazníky společnosti Acer, že se mohou vždy spolehnout na přesně zaměřenou a včasnou pomoc po dobu tří let v jakékoli zemi Evropského hospodářského společenství a že tedy budou moci optimálně využívat výrobek, který si zakoupili.     Zákazníci, kteří si koupí program AcerAdvantage k výrobku Acer, musí jednoduše aktivovat smlouvu na webových stránkách www.acer-ee.com nebo telefonicky v Evropském Call Centru (anglicky nebo německy). Aktivace může být vyřízena i prostřednictvím prodejce. Dále musí poslat podepsanou přihlášku spolu s prodejním dokladem v obálce, která je součástí balíčku AcerAdvantage. Společnost Acer zašle zákazníkovi kopii osvědčení o prodloužené záruce s veškerými identifikačnímu údaji o výrobku.     Rozšířené záruky, individuální služby a Evropské Call Centrum jsou součástí integrované strategie 'Péče o zákazníky', kterou společnost Acer s úspěchem zavedla na trhu se záměrem upevnit vztahy se zákazníky a dosáhnout jedinečné úrovně řízení vztahů se zákazníky.     Vaše práce si zaslouží ochranu a společnost Acer Vám nabízí možnost průběžně používat naše výrobky v rámci programu prodloužené záruky AcerAdvantage.","false","1","0001000400090007","7735","33","true","00020065","4164","-1","true","0","Měsíc(ů)","","0001-01-01T00:00:00","803.00","KS","0.00","1","2019-01-03T10:26:52.123","ACR","127","false","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_30