      ","N","","false",""),("348856","505679","ACER prodloužení záruky na 3 roky ON-SITE NBD (5x9), PC Veriton 2/4, Extensa (M,N,X,S,L), elektronicky","593.00","593.00","ACP","0.00","0.00","0.000000","0.000","36 Měsíc(ů)","ACER PC","593.00","853.00","21.00","SV.WPCA0.B09","false","0,00","","Acer","49119900","505679","ACER prodloužení záruky na 3 roky ON-SITE NBD (5x9), PC Veriton 2/4, Extensa (M,N,X,S,L), elektronicky","Typ servisní služby:Prodloužení záruky při koupi; Délka servisní služby (v letech):3","1","&lt;table dir='LTR' border='1' width='636' cellspacing='1' cellpadding='2'&gt;  &lt;tbody&gt;  &lt;tr&gt;  &lt;td bgcolor='#99cc00' width='22%' height='484'&gt;  &lt;p align='CENTER'&gt;NO BOOKLET&lt;/p&gt;  &lt;p align='CENTER'&gt;&lt;span style='font-family: Calibri; font-size: medium;'&gt;ON-SITE NBD&lt;/span&gt;&lt;/p&gt;  &lt;/td&gt;  &lt;td width='78%' height='484'&gt;  &lt;p&gt;ACER prodloužení záruky na 3 roky ON-SITE NBD (5x9), PC Veriton 2/4, Extensa (M,N,X,S,L), elektronicky&lt;/p&gt;  &lt;p align='LEFT'&gt; &lt;/p&gt;  &lt;p align='LEFT'&gt; &lt;/p&gt;  &lt;p align='LEFT'&gt;Záruku je nutné zaregistrovat do 365 dnů od prodeje produktu koncovému zákazníkovi, v opačném případě nebude prodloužená záruka akceptována.&lt;/p&gt;  &lt;p align='LEFT'&gt; &lt;/p&gt;  &lt;p align='LEFT'&gt;Služba Acer Care Plus:&lt;/p&gt;  &lt;p align='LEFT'&gt;ON-SITE NBD (5x9) - specializovaná asistence prováděná u zákazníka s reakcí do druhého pracovního dne (v případě nahlášení požadavku do 14h) v řežimu 5x9 (po-pá, 8-17h). Prodlouženou záruku lze uplatnit v České republice a na Slovensku.&lt;/p&gt;  &lt;p align='LEFT'&gt; &lt;/p&gt;  &lt;p align='LEFT'&gt;Návod na registraci:&lt;/p&gt;  &lt;p align='LEFT'&gt;Po zakoupení prodloužené záruky obdržíte od distributora formulář, kde je třeba doplnit jméno koncového zákazníka, seriové číslo produktu a datum prodeje. Vyplněný formulář pošlete emailem do servisního střediska Acer na adresu service.brno@acer.com a po registraci p