ního střediska HP, opravu nebo výměnu vadné jednotky a vrácení plně funkční jednotky.     Všechny služby zahrnují veškeré součásti, práci a náklady na dopravu při vrácení. HP nabízí dvě kategorie služeb, které představují možnosti dopravy do servisního střediska HP, jak je detailně uvedeno viz dále.   Pomocí doplňkové služby Accidental Damage Protection (ochrana proti náhodnému poškození) se vyhnete neočekávaným nákladům za opravu nebo výměnu poškozených jednotek v důsledku běžného provozu Vašeho mobilního výrobku.    Ochrana proti náhodnému poškození není běžně součástí standardní záruky ani jiných služeb HP Care Pack.","false","0","0001004600040002","1776","-1","true","00020099","4198","-1","true","0","Měsíc(ů)","MN","0001-01-01T00:00:00","2017.00","KS","0.00","1","2011-09-13T16:01:48.55","HPC","127","false","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_359\/359636_0a_3.jpg'}","        <productnavigatordata>          <attributecode>136</attributecode>          <valuecode>616</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>137</attributecode>          <valuecode>620</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>138</attributecode>          <valuecode>624</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>1</weight>          <length>1</length>          <width>1</width>          <height>1</height>        </productlogisticdata>      ","N","","false",""),("362759","348160","HP CPe - Carepack 3y NextBusDay Onsite DT D2/3/5 series (1-1-1standard warranty) excl/Mon HW Supp","1488.00","1488.00","HPC","0.00","0.00","0.000000","0.000","0 Měsíc(ů)","HP PSG COMMERCIAL","1494.00","1722.00","21.00","HP727E","false","0,00","","HP Inc.","49119900","","HP CPe - Carepack 3y NextBusDay Onsite DT D2/3/5 series (1-1-1standard warranty) excl/Mon HW Supp","Typ servisní služby:Prodloužení záru