lign='LEFT'&gt;Služba Acer Care Plus:&lt;/p&gt;  &lt;p align='LEFT'&gt;ON-SITE NBD (5x9) - specializovaná asistence prováděná u zákazníka s reakcí do druhého pracovního dne (v případě nahlášení požadavku do 14h) v řežimu 5x9 (po-pá, 8-17h). Prodlouženou záruku lze uplatnit v České republice a na Slovensku.&lt;/p&gt;  &lt;p align='LEFT'&gt; &lt;/p&gt;  &lt;p align='LEFT'&gt;Návod na registraci:&lt;/p&gt;  &lt;p align='LEFT'&gt;Po zakoupení prodloužené záruky obdržíte od distributora formulář, kde je třeba doplnit jméno koncového zákazníka, seriové číslo produktu a datum prodeje. Vyplněný formulář pošlete emailem do servisního střediska Acer na adresu service.brno@acer.com a po registraci prodloužené záruky dostanete na email potvrzení o registraci.&lt;/p&gt;  &lt;p align='LEFT'&gt; &lt;/p&gt;  &lt;p align='LEFT'&gt;Prodloužená záruka se nevztahuje na baterii.&lt;/p&gt;  &lt;p align='LEFT'&gt; &lt;/p&gt;  &lt;p align='LEFT'&gt;Platnost prodloužené záruky můžete ověřit v servisním centru:&lt;/p&gt;  &lt;p align='LEFT'&gt;+420 531 027 777, +421 2 3333 1027&lt;/p&gt;  &lt;p align='LEFT'&gt;www.acer.com/ac/cs/CZ/content/service-center&lt;/p&gt;  &lt;p align='LEFT'&gt; &lt;/p&gt;  &lt;/td&gt;  &lt;/tr&gt;  &lt;/tbody&gt;  &lt;/table&gt;  &lt;p&gt; &lt;/p&gt;","false","0","0001000400090007","7735","-1","true","00020065","4164","-1","true","36","Měsíc(ů)","","0001-01-01T00:00:00","766.00","KS","0.00","1","2019-01-08T09:57:38.057","ACR","127","false","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_366\/366965_0a_3.jpg'}","        <productnavigatordata>          <attributecode>136</attributecode>          <valuecode>616</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>137</attributecode>          <valuecode>621</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>138</attributecode>          <valuecode>624</valuecode>        </productnavigatordata>      ","        <productlogisticdata>  