g","49119900","","SAMSUNG servispack - prodloužení záruky +1rok pro modely: Series 9, 7, 6, 5, notebook + XE500, XE700","Typ servisní služby:Prodloužení záruky při koupi; Délka servisní služby (v letech):1; Typ opravy:V servise","1","&lt;p&gt;Samsung záruka - rozšíření ze dvou na tři roky&lt;br /&gt;Pro modely: Series 9, 7, 6, 5, notebook + XE500, XE700&lt;/p&gt;","false","0","000102210004","8402","38","true","00020099","4198","222","true","24","Měsíc(ů)","","0001-01-01T00:00:00","499.00","KS","0.00","1","2013-03-26T09:12:57","SAM","127","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_423\/423916_0a_3.jpg'}","        <productnavigatordata>          <attributecode>137</attributecode>          <valuecode>619</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>136</attributecode>          <valuecode>616</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>138</attributecode>          <valuecode>624</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0</weight>          <length>0</length>          <width>0</width>          <height>0</height>        </productlogisticdata>      ","N","","false",""),("426449","476775","ASUS Premium Care - Prodloužení záruky na 3 roky, pro NTB, CZ, elekronická","673.00","673.00","ASN","0.00","0.00","0.000000","0.000","36 Měsíc(ů)","ASUS PC","673.00","768.00","21.00","ACCX002-4DN0","false","0,00","","Asus","49119900","","ASUS Premium Care - Prodloužení záruky na 3 roky, pro NTB, CZ, elekronická","Typ servisní služby:Prodloužení záruky při koupi; Typ záruční  opravy:V servise","1","&lt;h2 dir='ltr' align='left'&gt;Buďte klidnější!&lt;/h2&gt;  &lt;p&gt;&lt;span style='font-family: Tahoma; color: #1d1d1b; font-size: xx-small;'&gt;&lt;span style='font-family: Tahoma; color: #1d1d1b; font-size: xx-small;'&gt;&lt;span style='font-family: Tahoma; color: #1d1d1b; font-size: xx-small;'&gt;Užijte si klid po uplynutí standrardní doby záruky&lt;br /&gt;ASUS Prodloužení záruky pokrývá závady nebo poruchy, které se objeví během záruční doby a v běžných podmínkách používání, stejně jako chyby materiálů nebo zpracování. Toto sníží možné náklady na opravu a ušetří vzácný čas, po vypršení standardní záruční doby a také zabezpečí, že Váš ASUS produkt bude pracovat pořád na plný výkon.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;  &lt;p&gt;&lt;span style='font-family: Tahoma; color: #1d1d1b; font-size: xx-small;'&gt;&lt;span style='font-family: Tahoma; color: #1d1d1b; font-size: xx-small;'&gt;&lt;span style='font-family: Tahoma; color: #1d1d1b; font-size: xx-small;'&gt;Lehké nakupování, lehké používáníPo koupi ASUS Prodloužené záruky Vám na Váš email zašleme aktivační kód a heslo. Okamžitě si můžete aktivovat ASUS Prodloužení záruky na ASUS členské stránce!Aktivace Prodloužení zárukyKrok 1: Staňte se členem ASUS Navštivte členskou stránku ASUS a zaregistrujte se jako člen ASUS. Pokud už ASUS členem jste, pokračujte krokem 2. Krok 2: Zaregistrujte Váš produkt Přihlašte se na členskou stránku ASUS a klikněte na 'Registrace produktu' v levé nabídce menu. Prosím, vyplňte dotazník s relevantními informacemi Vašeho produktu ASUS. Pokud jste si už Váš produkt zaregistrovali, pokračujte krokem 3. Krok 3: Aktivujte si Vaší záruční služb. Klikněte na 'Aktivace Prodloužení záruky' v levé nabídce menu a následujte instrukce. Vyberte si registrovaný produkt, pro který jste si zakoupili prodlouženou záruku a vložte kód smlouvy a heslo. Klikněte na 'odeslat' pro ukončení registrace.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;  &lt;p&gt;&lt;span style='font-family: Tahoma; color: #1d1d1b; font-size: xx-small;'&gt;1. Prodlužte si záruku až na 3 roky od data zakoupení svého ASUS produktu. &lt;br /&gt;2. Bezproblémová oprava nebo výměna včetně dílů a práce. &lt;br /&gt;3. Přímá podpora od experta ASUS. &lt;br /&gt;4. S Celosvětovým rozšířením záruky si užijete servisních služeb v kterémkoliv autorizovaném ASUS servisním centru během trvání vaší rozšířené záruky.&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;Podmínky nákupu&lt;br /&gt;možné použít jenom na ASUS notebooky s 2-letou zárukou, musí být zakoupena během š12 měsíců od nákupu ASUS produktu&lt;br /&gt;&lt;br /&gt;Podmínky Prodloužení záruky&lt;br /&gt;*musí být aktivována online po obdržení aktivačního kódu a hesla &lt;br /&gt;*nevztahuje se na software, baterii, příslušenství (myš, brašnu, adaptér…) a škody způsobené zákazníkem &lt;br /&gt;*celosvětová záruka je limitována pouze na možnosti zemí, v kterých je tento servis poptáván. &lt;br /&gt;*Možnosti záruky, dostupnost součástek a doba vyřízení se můžou lišit v závislosti od země &lt;br /&gt;&lt;br /&gt;Omezení prodloužení záruky&lt;br /&gt;Rozšíření záruky se vztahuje pouze na závady nebo poruchy, které nastanou v průběhu záruční doby a za normálních podmínek použití, jakož i veškeré materiální nebo výrobní vady. Rozšíření záruky neplatí, jestliže.:&lt;br /&gt;&lt;br /&gt;1. S výrobkem bylo neodporně manipulováno, byl opraven, nebo upraven ne-autorizovaným personálem. &lt;br /&gt;2. Sériové číslo výrobku, součásti nebo příslušenství bylo pozměněno, zrušeno, nebo odstraněno. &lt;br /&gt;3. Záruční pečeť byla porušena, rozmazána, nebo změněna. &lt;br /&gt;4. Je škoda způsobena vnější elektrickou poruchou, jakoukoliv nehodou, přírodní katastrofou, úmyslným či neúmyslným nesprávným použitím, zanedbáváním či nesprávnou údržbou nebo použitím za mimořádných podmínek. &lt;br /&gt;5. Je škoda způsobena nesprávnou instalací nebo nesprávným připojením k periferním zařízením jako je tiskárna, externí optická jednotka, a jiné podobné zařízení. &lt;br /&gt;6. Je škoda způsobena použitím mimo určený provoz, vytyčené parametry nebo životní prostředí, které jsou podrobně specifikované v Uživatelské příručce Vašeho produktu. &lt;br /&gt;7. Je škoda způsobena užíváním částí, které nejsou vyráběny nebo prodávány společností ASUS. &lt;br /&gt;8. K poškození nebo ztrátě programů, dat a vyměnitelných paměťových médií, nebo jsou-li náklady související s obnovou programu nebo dat. &lt;br /&gt;9. Je škoda způsobena softwary třetích stran nebo počítačovými viry. &lt;br /&gt;10. Pokud dojde ke ztrátě softwaru nebo ztrátě dat, které mohou nastat v průběhu opravy nebo výměny.&lt;/span&gt;&lt;/p&gt;","false","0","0001001100080030","8358","-1","true","00020168","8499","-1","true","36","Měsíc(ů)","","0001-01-01T00:00:00","673.00","KS","0.00","1","2017-03-21T13:20:42.593","ASU","127","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_426\/426449_0a_3.jpg'}","        <productnavigatordata>          <attributecode>136</attributecode>          <valuecode>616</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>138</attributecode>          <valuecode>624</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0</weight>          <length>0</length>          <width>0</width>          <height>0</height>        </productlogisticdata>      ","N","","false",""),("438417","405769","LENOVO záruka pro ThinkPad elektronická - z délky 1rok Carry-In  &gt;&gt;&gt;  3 roky On-Site","1691.00","1691.00","LEN","0.00","0.00","0.000000","0.000","12 Měsíc(ů)","LENOVO SMB CZ","1691.00","1941.00","21.00","5WS0A14086","false","0,00","","Lenovo","49119900","","LENOVO záruka pro ThinkPad elektronická - z délky 1rok Carry-In  &gt;&gt;&gt;  3 roky On-Site","Typ servisní služby:Prodloužení záruky při koupi; Délka servisní služby (v letech):3; Typ záruční  opravy:Na místě","1","&lt;p&gt;Prodloužená záruka k notebookům řady ThinkPad&lt;/p&gt;  &lt;p&gt;&lt;br /&gt;&lt;strong&gt;Prodlužuje se z výchozí záruky:&lt;/strong&gt; 12 měsíců Carry-In&lt;br /&gt;&lt;strong&gt;Prodlužuje se na novou záruku:&lt;/strong&gt; 36 měsíců On-Site&lt;/p&gt;  &lt;p&gt; &lt;/p&gt;","false","0","0001005200060009",