r&lt;/p&gt;  &lt;p align='LEFT'&gt; &lt;/p&gt;  &lt;/td&gt;  &lt;/tr&gt;  &lt;/tbody&gt;  &lt;/table&gt;  &lt;p&gt; &lt;/p&gt;","false","0","0001000400090007","7735","-1","true","00020163","7405","-1","true","0","Měsíc(ů)","","0001-01-01T00:00:00","1973.00","KS","0.00","1","2019-01-08T10:00:15.53","ACR","127","false","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_995\/995011_0a_3.jpg'}","        <productnavigatordata>          <attributecode>136</attributecode>          <valuecode>617</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>137</attributecode>          <valuecode>621</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>138</attributecode>          <valuecode>624</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0</weight>          <length>0</length>          <width>0</width>          <height>0</height>        </productlogisticdata>      ","N","","false",""),("1049953","1503342","HP 1 year post warranty Next business day onsite Hardware Support for Notebooks","4289.00","4289.00","HPC","0.00","0.00","0.000000","0.000","0 Měsíc(ů)","HP PSG COMMERCIAL","4309.00","4945.00","21.00","HX552PE","false","0,00","","HP Inc.","49119900","","HP 1 year post warranty Next business day onsite Hardware Support for Notebooks","Typ servisní služby:Prodloužení záruky při koupi; Délka servisní služby (v letech):1; Typ záruční  opravy:Na místě","1","Typ servisnej služby:Predĺženie záruky pri kúpe; Dĺžka servisnej služby (v rokoch):1; Typ opravy:Na mieste","false","0","0001004600040002","1776","-1","true","00020099","4198","-1","true","0","Měsíc(ů)","MG","0001-01-01T00:00:00","4309.00","KS","0.00","1","2018-04-10T16:53:55.707","HPC","127","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1049\/1049953_0a_3.jpg'}","        <productnavigatordata>          <attributecode>137</attributecode>  