 koupi; Délka servisní služby (v letech):4; Typ opravy:Na místě","1","Tato záruka slouží nejen pro cestovatele do zahraničí, ale i jako jakási pojistka na závady Vámi způsobené = vylití tekutiny do klávesnice, pád NTB na zem a podobně.   záruku můžete dokoupit a zaregistrovat do 90dnů (!!!) od data zakoupení notebooku  MOŽNO ZAREGISTROVAT  ZDE:http://www.aceradvantage.com/advantage/page1.do?link=ln1817&amp;UserCtxParam=0&amp;GroupCtxParam=0&amp;ctx1=cz&amp;ctx6=6&amp;ctx7=3 &lt;br&gt;  AcerAdvantage je program prodloužené záruky na výrobky Acer, který je neobyčejně úspěšný v zemích, v nichž byl zaveden. V současné době je rozšířen a nabízen ve všech zemích Evropského hospodářského společenství.    AcerAdvantage je evropský program, který lze zakoupit k výrobkům Acer, jako např. notebookům, osobním počítačům, LCD monitorům, projektorům, serverům a diskovým polím.     Nabízí tříletou prodlouženou záruku v několika variantách (v závislosti na výrobku a zvoleném typu prodloužené záruky. Další informace naleznete na webových stránkách pro příslušnou řadu výrobků), jako např.: servis v servisním středisku Acer nebo u zákazníka, různé časy odezvy od 4 hodin do 2 dnů, různé pokrytí od 5 do 7 dnů v týdnu a od 9 do 24 hodin denně, opravu v krátké lhůtě podle programu AcerAdvantage pro prioritní zákazníky a dočasnou náhradu tak, aby vždy byla zaručena nejvyšší možná dostupnost zakoupeného výrobku.   Dále vám nabízí mnoho dalších výhod, jako např. bezplatné opravy náhodných poškození pro notebooky a lhůtu opravy do pěti pracovních dnů, bezplatnou podporu prostřednictvím telefonu, faxu nebo elektronické pošty po celou dobu platnosti tříleté prodloužené záruky.     Cílem programu AcerAdvantage je přesvědčit zákazníky společnosti Acer, že se mohou vždy spolehnout na přesně zaměřenou a včasnou pomoc po dobu tří let v jakékoli zemi Evropského hospodářského společenství a že tedy budou moci optimálně využívat výrobek, který si zakoupili.     Zákazníci, kteří si koupí program AcerAdvantage k výrobku Acer, musí jednoduše aktivovat smlouvu na webových stránkách www.acer-ee.com nebo telefonicky v Evropském Call Centru (anglicky nebo německy). Aktivace může být vyřízena i prostřednictvím prodejce. Dále musí poslat podepsanou přihlášku spolu s prodejním dokladem v obálce, která je součástí balíčku AcerAdvantage. Společnost Acer zašle zákazníkovi kopii osvědčení o prodloužené záruce s veškerými identifikačnímu údaji o výrobku.     Rozšířené záruky, individuální služby a Evropské Call Centrum jsou součástí integrované strategie 'Péče o zákazníky', kterou společnost Acer s úspěchem zavedla na trhu se záměrem upevnit vztahy se zákazníky a dosáhnout jedinečné úrovně řízení vztahů se zákazníky.     Vaše práce si zaslouží ochranu a společnost Acer Vám nabízí možnost průběžně používat naše výrobky v rámci programu prodloužené záruky AcerAdvantage.","false","1","0001000400090007","7735","-1","true","00020250","9196","-1","true","36","Měsíc(ů)","","0001-01-01T00:00:00","1999.00","KS","0.00","1","2020-02-28T13:14:30.28","ACR","127","false","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1509\/1509215_0a_3.jpg'}","        <productnavigatordata>          <attributecode>136</attributecode>          <valuecode>616</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>137</attributecode>          <valuecode>622</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>138</attributecode>          <valuecode>625</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0</weight>          <length>0</length>          <width>0</width>          <height>0</height>        </productlogisticdata>      ","N","","false",""),("1509673","1509803","HP CPe - HP 4y NextBusDay Onsite WS Only HW Supp","2248.00","2248.00","HPC","0.00","0.00","0.000000","0.000","0 Měsíc(ů)","HP PSG COMMERCIAL","2248.00","2583.00","2