lužbou přímo na místě Vás můžou naši agenti technické podpory požádat o pomoc s řešením problémů s Výrobkem. Pro více detailních informací, prosím, nahlédněte do sekce „Když kontaktujete zákaznickou službu ASUS“ na Záruční kartě dodané s Vaším Výrobkem nebo navštivte http://support.asus.com/.    • Pokud se problém nevyřeší na dálku, pak bude domluvena technická podpora pro Váš Výrobek přímo na místě. Autorizovaný ASUS technik bude poslaný obvykle do konce dalšího pracovního dne na Vaše místo. Doba odezvy může záležet na geografickém umístění, náhradních dílech a dostupnosti místní služby.    • Budete požádáni, abyste autorizovanému ASUS technikovi poskytli přístup k Vaší budově a výrobkům ASUS a také elektřině, internetovému připojení, CD/DVD s ASUS ovladači (pokud bylo dodáno k výrobku) a dostatečnému a bezpečnému pracovnímu prostředí.    • Pokud výrobek selže během normálního a správného používání v době trvání tohoto servisního balíčku, ASUS opraví nebo vymění poškozené díly výrobku, nebo celý Výrobek za nové nebo repasované díly nebo výrobky tak, aby funkčnost byla stejná, nebo lepší než původní.    • Pokud jsou poškozené díly vyměněny touto službou, pak poskytujete předem souhlas, aby se vyměněné poškozené díly převedly do vlastnictví ASUSu.    • V případě, že autorizovaný ASUS technik zjistí, že Výrobek je mimo rozsah pokrytí (jako například poškození způsobené zákazníkem atd. jak je popsáno v sekci „Vyloučení z této limitované Záruční služby“ na Záruční kartě), bude Vám vystaven ceník a tato Služba bude poskytnuta pouze po zaplacení. Pokud se rozhodnete nepokračovat v opravě, pak Vám budou naúčtovány všechny již vzniklé náklady společnosti Asus (včetně, ale nejen poslání technika na místo, testování/hledání chyby atd.)    Podmínky    záruka musí být zakoupena a aktivována do 6 měsíců po zakoupení vašeho asus výrobku.","false","0","","-1","-1","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","673.00","KS","0.00","1","2020-07-22T10:57:18.45","ASU","127","false","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1521\/1521989_0a_3.jpg'}","        <productnavigatordata>          <attributecode>136</attributecode>          <valuecode>616</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>138</attributecode>          <valuecode>624</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0</weight>          <length>0</length>          <width>0</width>          <height>0</height>        </productlogisticdata>      ","N","","false",""),("1522691","482765","ASUS Premium Care - Prodloužení záruky na 3 roky, pro NX NTB (Commercial Notebook), CZ, elekronická","605.00","605.00","ASN","0.00","0.00","0.000000","0.000","36 Měsíc(ů)","ASUS PC","605.00","691.00","21.00","ACX10-004011NX","false","0,00","","Asus","49119900","","ASUS Premium Care - Prodloužení záruky na 3 roky, pro NX NTB (Commercial Notebook), CZ, elekronická","Typ servisní služby:Prodloužení záruky při koupi; Typ záruční  opravy:V servise","1","&lt;h2 dir='ltr' align='left'&gt;Buďte klidnější!&lt;/h2&gt;  &lt;p&gt;&lt;span style='font-family: Tahoma; color: #1d1d1b; font-size: xx-small;'&gt;&lt;span style='font-family: Tahoma; color: #1d1d1b; font-size: xx-small;'&gt;&lt;span style='font-family: Tahoma; color: #1d1d1b; font-size: xx-small;'&gt;Užijte si klid po uplynutí standrardní doby záruky&lt;br /&gt;ASUS Prodloužení záruky pokrývá závady nebo poruchy, které se objeví během záruční doby a v běžných podmínkách používání, stejně jako chyby materiálů nebo zpracování. Toto sníží možné náklady na opravu a ušetří vzácný čas, po vypršení standardní záruční doby a také zabezpečí, že Váš ASUS produkt bude pracovat pořád na plný výkon.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;  &lt;p&gt;&lt;span style='font-family: Tahoma; color: #1d1d1b; font-size: xx-small;'&gt;&lt;span style='font-family: Tahoma; color: #1d1d1b; font-size: xx-small;'&gt;&lt;span style='font-family: Tahoma; color: #1d1d1b; font-size: xx-small;'&gt;Lehké nakupování, lehké používáníPo koupi ASUS Prodloužené záruky Vám na Váš email zašleme aktivační kód a heslo. Okamžitě si můžete aktivovat ASUS Prodloužení záruky na ASUS členské stránce!Aktivace Prodloužení zárukyKrok 1: Staňte se členem ASUS Navštivte členskou stránku ASUS a zaregistrujte se jako člen ASUS. Pokud už ASUS členem jste, pokračujte krokem 2. Krok 2: Zaregistrujte Váš produkt Přihlašte se na členskou stránku ASUS a klikněte na 'Registrace produktu' v levé nabídce menu. Prosím, vyplňte dotazník s relevantními informacemi Vašeho produktu ASUS. Pokud jste si už Váš produkt zaregistrovali, pokračujte krokem 3. Krok 3: Aktivujte si Vaší záruční služb. Klikněte na 'Aktivace Prodloužení záruky' v levé nabídce menu a následujte instrukce. Vyberte si registrovaný produkt, pro který jste si zakoupili prodlouženou záruku a vložte kód smlouvy a heslo. Klikněte na 'odeslat' pro ukončení registrace.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;  &lt;p&gt;&lt;span style='font-family: Tahoma; color: #1d1d1b; font-size: xx-small;'&gt;1. Prodlužte si záruku až na 3 roky od data zakoupení svého ASUS produktu. &lt;br /&gt;2. Bezproblémová oprava nebo výměna včetně dílů a práce. &lt;br /&gt;3. Přímá podpora od experta ASUS. &lt;br /&gt;4. S Celosvětovým rozšířením záruky si užijete servisních služeb v kterémkoliv autorizovaném ASUS servisním centru během trvání vaší rozšířené záruky.&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;Podmínky nákupu&lt;br /&gt;možné použít jenom na ASUS notebooky s 2-letou zárukou, musí být zakoupena během š12 měsíců od nákupu ASUS produktu&lt;br /&gt;&lt;br /&gt;Podmínky Prodloužení záruky&lt;br /&gt;*musí být aktivována online po obdržení aktivačního kódu a hesla &lt;br /&gt;*nevztahuje se na software, baterii, příslušenství (myš, brašnu, adaptér…) a škody způsobené zákazníkem &lt;br /&gt;*celosvětová záruka je limitována pouze na možnosti zemí, v kterých je tento servis poptáván. &lt;br /&gt;*Možnosti záruky, dostupnost součástek a doba vyřízení se můžou lišit v závislosti od země &lt;br /&gt;&lt;br /&gt;Omezení prodloužení záruky&lt;br /&gt;Rozšíření záruky se vztahuje pouze na závady nebo poruchy, které nastanou v průběhu záruční doby a za normálních podmínek použití, jakož i veškeré materiální nebo výrobní vady. Rozšíření záruky neplatí, jestliže.:&lt;br /&gt;&lt;br /&gt;1. S výrobkem bylo neodporně manipulováno, byl opraven, nebo upraven ne-autorizovaným personálem. &lt;br /&gt;2. Sériové číslo výrobku, součásti nebo příslušenství bylo pozměněno, zrušeno, nebo odstraněno. &lt;br /&gt;3. Záruční pečeť byla porušena, rozmazána, nebo změněna. &lt;br /&gt;4. Je škoda způsobena vnější elektrickou poruchou, jakoukoliv nehodou, přírodní katastrofou, úmyslným či neúmyslným nesprávným použitím, zanedbáváním či nesprávnou údržbou nebo použitím za mimořádných podmínek. &lt;br /&gt;5. Je škoda způsobena nesprávnou instalací nebo nesprávným připojením k periferním zařízením jako je tiskárna, externí optická jednotka, a jiné podobné zařízení. &lt;br /&gt;6. Je škoda způsobena použitím mimo určený provoz, vytyčené parametry nebo životní prostředí, které jsou podrobně specifikované v Uživatelské příručce Vašeho produktu. &lt;br /&gt;7. Je škoda způsobena užíváním částí, které nejsou vyráběny nebo prodávány společností ASUS. &lt;br /&gt;8. K poškození nebo ztrátě programů, dat a vyměnitelných paměťových médií, nebo jsou-li náklady související s obnovou programu nebo dat. &lt;br /&gt;9. Je škoda způsobena softwary třetích stran nebo počítačovými viry. &lt;br /&gt;10. Pokud dojde ke ztrátě softwaru nebo ztrátě dat, které mohou nastat v průběhu opravy nebo výměny.&lt;/span&gt;&lt;/p&gt;","false","0","0001001100080030","8358","-1","true","00020168","8499","-1","true","36","Měsíc(ů)","","0001-01-01T00:00:00","605.00","KS","0.00","1","2020-07-17T14:21:10.813","ASU","127","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1522