 nakupování, lehké používáníPo koupi ASUS Prodloužené záruky Vám na Váš email zašleme aktivační kód a heslo. Okamžitě si můžete aktivovat ASUS Prodloužení záruky na ASUS členské stránce!Aktivace Prodloužení zárukyKrok 1: Staňte se členem ASUS Navštivte členskou stránku ASUS a zaregistrujte se jako člen ASUS. Pokud už ASUS členem jste, pokračujte krokem 2. Krok 2: Zaregistrujte Váš produkt Přihlašte se na členskou stránku ASUS a klikněte na 'Registrace produktu' v levé nabídce menu. Prosím, vyplňte dotazník s relevantními informacemi Vašeho produktu ASUS. Pokud jste si už Váš produkt zaregistrovali, pokračujte krokem 3. Krok 3: Aktivujte si Vaší záruční služb. Klikněte na 'Aktivace Prodloužení záruky' v levé nabídce menu a následujte instrukce. Vyberte si registrovaný produkt, pro který jste si zakoupili prodlouženou záruku a vložte kód smlouvy a heslo. Klikněte na 'odeslat' pro ukončení registrace.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;  &lt;p&gt;&lt;span style='font-family: Tahoma; color: #1d1d1b; font-size: xx-small;'&gt;1. Prodlužte si záruku až na 3 roky od data zakoupení svého ASUS produktu. &lt;br /&gt;2. Bezproblémová oprava nebo výměna včetně dílů a práce. &lt;br /&gt;3. Přímá podpora od experta ASUS. &lt;br /&gt;4. S Celosvětovým rozšířením záruky si užijete servisních služeb v kterémkoliv autorizovaném ASUS servisním centru během trvání vaší rozšířené záruky.&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;Podmínky nákupu&lt;br /&gt;možné použít jenom na ASUS notebooky s 2-letou zárukou, musí být zakoupena během š12 měsíců od nákupu ASUS produktu&lt;br /&gt;&lt;br /&gt;Podmínky Prodloužení záruky&lt;br /&gt;*musí být aktivována online po obdržení aktivačního kódu a hesla &lt;br /&gt;*nevztahuje se na software, baterii, příslušenství (myš, brašnu, adaptér…) a škody způsobené zákazníkem &lt;br /&gt;*celosvětová záruka je limitována pouze na možnosti zemí, v kterých je tento servis poptáván. &lt;br /&gt;*Možnosti záruky, dostupnost součástek a doba vyřízení se můžou lišit v závislosti od země &lt;br /&gt;&lt;br /&gt;Omezení prodloužení záruky&lt;br /&gt;Rozšíření záruky se vztahuje pouze na závady nebo poruchy, které nastanou v průběhu záruční doby a za normálních podmínek použití, jakož i veškeré materiální nebo výrobní vady. Rozšíření záruky neplatí, jestliže.:&lt;br /&gt;&lt;br /&gt;1. S výrobkem bylo neodporně manipulováno, byl opraven, nebo upraven ne-autorizovaným personálem. &lt;br /&gt;2. Sériové číslo výrobku, součásti nebo příslušenství bylo pozměněno, zrušeno, nebo odstraněno. &lt;br /&gt;3. Záruční pečeť byla porušena, rozmazána, nebo změněna. &lt;br /&gt;4. Je škoda způsobena vnější elektrickou poruchou, jakoukoliv nehodou, přírodní katastrofou, úmyslným či neúmyslným nesprávným použitím, zanedbáváním či nesprávnou údržbou nebo použitím za mimořádných podmínek. &lt;br /&gt;5. Je škoda způsobena nesprávnou instalací nebo nesprávným připojením k periferním zařízením jako je tiskárna, externí optická jednotka, a jiné podobné zařízení. &lt;br /&gt;6. Je škoda způsobena použitím mimo určený provoz, vytyčené parametry nebo životní prostředí, které jsou podrobně specifikované v Uživatelské příručce Vašeho produktu. &lt;br /&gt;7. Je škoda způsobena užíváním částí, které nejsou vyráběny nebo prodávány společností ASUS. &lt;br /&gt;8. K poškození nebo ztrátě programů, dat a vyměnitelných paměťových médií, nebo jsou-li náklady související s obnovou programu nebo dat. &lt;br /&gt;9. Je škoda způsobena softwary třetích stran nebo počítačovými viry. &lt;br /&gt;10. Pokud dojde ke ztrátě softwaru nebo ztrátě dat, které mohou nastat v průběhu opravy nebo výměny.&lt;/span&gt;&lt;/p&gt;","false","0","0001001100080030","8358","-1","true","00020168","8499","-1","true","36","Měsíc(ů)","","0001-01-01T00:00:00","1216.00","KS","0.00","1","2020-07-17T14:25:50.667","ASU","127","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1522\/1522694_0a_3.jpg'}","        <productnavigatordata>          <attributecode>136</attributecode>     