áruky na ASUS členské stránce!Aktivace Prodloužení zárukyKrok 1: Staňte se členem ASUS Navštivte členskou stránku ASUS a zaregistrujte se jako člen ASUS. Pokud už ASUS členem jste, pokračujte krokem 2. Krok 2: Zaregistrujte Váš produkt Přihlašte se na členskou stránku ASUS a klikněte na 'Registrace produktu' v levé nabídce menu. Prosím, vyplňte dotazník s relevantními informacemi Vašeho produktu ASUS. Pokud jste si už Váš produkt zaregistrovali, pokračujte krokem 3. Krok 3: Aktivujte si Vaší záruční služb. Klikněte na 'Aktivace Prodloužení záruky' v levé nabídce menu a následujte instrukce. Vyberte si registrovaný produkt, pro který jste si zakoupili prodlouženou záruku a vložte kód smlouvy a heslo. Klikněte na 'odeslat' pro ukončení registrace.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;  &lt;p&gt;&lt;span style='font-family: Tahoma; color: #1d1d1b; font-size: xx-small;'&gt;1. Prodlužte si záruku až na 3 roky od data zakoupení svého ASUS produktu. &lt;br /&gt;2. Bezproblémová oprava nebo výměna včetně dílů a práce. &lt;br /&gt;3. Přímá podpora od experta ASUS. &lt;br /&gt;4. S Celosvětovým rozšířením záruky si užijete servisních služeb v kterémkoliv autorizovaném ASUS servisním centru během trvání vaší rozšířené záruky.&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;Podmínky nákupu&lt;br /&gt;možné použít jenom na ASUS notebooky s 2-letou zárukou, musí být zakoupena během š12 měsíců od nákupu ASUS produktu&lt;br /&gt;&lt;br /&gt;Podmínky Prodloužení záruky&lt;br /&gt;*musí být aktivována online po obdržení aktivačního kódu a hesla &lt;br /&gt;*nevztahuje se na software, baterii, příslušenství (myš, brašnu, adaptér…) a škody způsobené zákazníkem &lt;br /&gt;*celosvětová záruka je limitována pouze na možnosti zemí, v kterých je tento servis poptáván. &lt;br /&gt;*Možnosti záruky, dostupnost součástek a doba vyřízení se můžou lišit v závislosti od země &lt;br /&gt;&lt;br /&gt;Omezení prodloužení záruky&lt;br /&gt;Rozšíření záruky se vztahuje pouze na závady nebo poruchy, kte