t aktivována online po obdržení aktivačního kódu a hesla &lt;br /&gt;*nevztahuje se na software, baterii, příslušenství (myš, brašnu, adaptér…) a škody způsobené zákazníkem &lt;br /&gt;*celosvětová záruka je limitována pouze na možnosti zemí, v kterých je tento servis poptáván. &lt;br /&gt;*Možnosti záruky, dostupnost součástek a doba vyřízení se můžou lišit v závislosti od země &lt;br /&gt;&lt;br /&gt;Omezení prodloužení záruky&lt;br /&gt;Rozšíření záruky se vztahuje pouze na závady nebo poruchy, které nastanou v průběhu záruční doby a za normálních podmínek použití, jakož i veškeré materiální nebo výrobní vady. Rozšíření záruky neplatí, jestliže.:&lt;br /&gt;&lt;br /&gt;1. S výrobkem bylo neodporně manipulováno, byl opraven, nebo upraven ne-autorizovaným personálem. &lt;br /&gt;2. Sériové číslo výrobku, součásti nebo příslušenství bylo pozměněno, zrušeno, nebo odstraněno. &lt;br /&gt;3. Záruční pečeť byla porušena, rozmazána, nebo změněna. &lt;br /&gt;4. Je škoda způsobena vnější elektrickou poruchou, jakoukoliv nehodou, přírodní katastrofou, úmyslným či neúmyslným nesprávným použitím, zanedbáváním či nesprávnou údržbou nebo použitím za mimořádných podmínek. &lt;br /&gt;5. Je škoda způsobena nesprávnou instalací nebo nesprávným připojením k periferním zařízením jako je tiskárna, externí optická jednotka, a jiné podobné zařízení. &lt;br /&gt;6. Je škoda způsobena použitím mimo určený provoz, vytyčené parametry nebo životní prostředí, které jsou podrobně specifikované v Uživatelské příručce Vašeho produktu. &lt;br /&gt;7. Je škoda způsobena užíváním částí, které nejsou vyráběny nebo prodávány společností ASUS. &lt;br /&gt;8. K poškození nebo ztrátě programů, dat a vyměnitelných paměťových médií, nebo jsou-li náklady související s obnovou programu nebo dat. &lt;br /&gt;9. Je škoda způsobena softwary třetích stran nebo počítačovými viry. &lt;br /&gt;10. Pokud dojde ke ztrátě softwaru nebo ztrátě dat, které mohou nastat v průběhu opravy nebo výměny.&lt;/span&gt;&lt;/p&gt;","false","0","0001001100080030","8358","-1","true","00020168","8499","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","1166.00","KS","0.00","1","2020-07-17T14:34:25.737","ASU","127","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1522\/1522718_0a_3.jpg'}","        <productnavigatordata>          <attributecode>136</attributecode>          <valuecode>616</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>138</attributecode>          <valuecode>624</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0</weight>          <length>0</length>          <width>0</width>          <height>0</height>        </productlogisticdata>      ","N","","false",""),("1522719","482788","ASUS Premium Care - 2 roky - On-Site (NBD) + Local Accidental Damage Protection, Gaming NTB, CZ, el.","1970.00","1970.00","ASN","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","ASUS PC","1970.00","2250.00","21.00","ACX15-015100NR","false","0,00","","Asus","49119900","","ASUS Premium Care - 2 roky - On-Site (NBD) + Local Accidental Damage Protection, Gaming NTB, CZ, el.","Typ servisní služby:Prodloužení záruky při koupi; Typ záruční  opravy:V servise","1","&lt;h2 dir='ltr' align='left'&gt;Buďte klidnější!&lt;/h2&gt;  &lt;p&gt;&lt;span style='font-family: Tahoma; color: #1d1d1b; font-size: xx-small;'&gt;&lt;span style='font-family: Tahoma; color: #1d1d1b; font-size: xx-small;'&gt;&lt;span style='font-family: Tahoma; color: #1d1d1b; font-size: xx-small;'&gt;Užijte si klid po uplynutí standrardní doby záruky&lt;br /&gt;ASUS Prodloužení záruky pokrývá závady nebo poruchy, které se objeví během záruční doby a v běžných podmínkách používání, stejně jako chyby materiálů nebo zpracování. Toto sníží možné náklady na opravu a ušetří vzácný čas, po vypršení standardní záruční doby a také zabezpečí, že Váš ASUS produkt bude pracovat pořád na plný výkon.&lt;/span&gt;