bízí tříletou prodlouženou záruku v několika variantách (v závislosti na výrobku a zvoleném typu prodloužené záruky. Další informace naleznete na webových stránkách pro příslušnou řadu výrobků), jako např.: servis v servisním středisku Acer nebo u zákazníka, různé časy odezvy od 4 hodin do 2 dnů, různé pokrytí od 5 do 7 dnů v týdnu a od 9 do 24 hodin denně, opravu v krátké lhůtě podle programu AcerAdvantage pro prioritní zákazníky a dočasnou náhradu tak, aby vždy byla zaručena nejvyšší možná dostupnost zakoupeného výrobku.   Dále vám nabízí mnoho dalších výhod, jako např. bezplatné opravy náhodných poškození pro notebooky a lhůtu opravy do pěti pracovních dnů, bezplatnou podporu prostřednictvím telefonu, faxu nebo elektronické pošty po celou dobu platnosti tříleté prodloužené záruky.     Cílem programu AcerAdvantage je přesvědčit zákazníky společnosti Acer, že se mohou vždy spolehnout na přesně zaměřenou a včasnou pomoc po dobu tří let v jakékoli zemi Evropského hospodářského společenství a že tedy budou moci optimálně využívat výrobek, který si zakoupili.     Zákazníci, kteří si koupí program AcerAdvantage k výrobku Acer, musí jednoduše aktivovat smlouvu na webových stránkách www.acer-ee.com nebo telefonicky v Evropském Call Centru (anglicky nebo německy). Aktivace může být vyřízena i prostřednictvím prodejce. Dále musí poslat podepsanou přihlášku spolu s prodejním dokladem v obálce, která je součástí balíčku AcerAdvantage. Společnost Acer zašle zákazníkovi kopii osvědčení o prodloužené záruce s veškerými identifikačnímu údaji o výrobku.     Rozšířené záruky, individuální služby a Evropské Call Centrum jsou součástí integrované strategie 'Péče o zákazníky', kterou společnost Acer s úspěchem zavedla na trhu se záměrem upevnit vztahy se zákazníky a dosáhnout jedinečné úrovně řízení vztahů se zákazníky.     Vaše práce si zaslouží ochranu a společnost Acer Vám nabízí možnost průběžně používat naše výrobky v rámci programu prodloužené záruky AcerAdvantage.","false","1",