škeré příslušenství, které nebylo instalováno v notebooku při jeho zakoupení&lt;/li&gt;  &lt;li&gt;krádež či ztrátu notebooku&lt;/li&gt;  &lt;li&gt;úmyslné poškození přístroje&lt;/li&gt;  &lt;li&gt;poškození v důsledku zásahu vyšší moci&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt;&lt;strong&gt;Informace k registraci&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Ochrana proti náhodnému poškození platí pouze v ČESKÉ REPUBLICE.&lt;/li&gt;  &lt;li&gt;Jde o elektronickou licenci zasílanou emailem. Registrace bude probíhat standardním způsobem na webu pomocí autorizačních informací, které obdržíte v emailové licenci.&lt;/li&gt;  &lt;li&gt;Nezaregistrovaný service pack není platný!&lt;/li&gt;  &lt;li&gt;Záruka se musí zaregistrovat do 30 dnů od jejího zakoupení.&lt;/li&gt;  &lt;/ul&gt;","false","1","0001005200060009","9109","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","624.00","KS","0.00","1","2022-04-20T13:21:28.577","LEN","127","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1579\/1579864_0a_3.jpg'}","        <productnavigatordata>          <attributecode>136</attributecode>          <valuecode>616</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>137</attributecode>          <valuecode>619</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>138</attributecode>          <valuecode>624</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0</weight>          <length>0</length>          <width>0</width>          <height>0</height>        </productlogisticdata>      ","N","","false",""),("1579865","478653","LENOVO záruka ThinkPad elektronická - z délky Multiple  &gt;&gt;&gt;  1 rok Accidental Damage Protection L, T, X12 Detechable","676.00","676.00","LEN","0.00","0.00","0.000000","0.000","12 Měsíc(ů)","LENOVO SMB CZ","676.00","776.00","21.00","5PS0K18191","false","