040002","1776","-1","true","00020099","4198","-1","true","0","Měsíc(ů)","MG","0001-01-01T00:00:00","4540.00","KS","0.00","1","2021-10-20T17:18:24.213","HPC","127","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1603\/1603395_0a_3.jpg'}","        <productnavigatordata>          <attributecode>136</attributecode>          <valuecode>616</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>137</attributecode>          <valuecode>619</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>138</attributecode>          <valuecode>625</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0</weight>          <length>0</length>          <width>0</width>          <height>0</height>        </productlogisticdata>      ","N","","false",""),("1604267","1456795","HP CPe - HP 3Y 3 Day Onsite 2 Year wty Omen Spectre Service","2239.00","2239.00","HPA","0.00","0.00","0.000000","0.000","0 Měsíc(ů)","HP PSG CONSUMER","2288.00","2829.00","21.00","U0VS1E","false","0,00","","HP Inc.","49119900","","HP CPe - HP 3Y 3 Day Onsite 2 Year wty Omen Spectre Service","Typ servisní služby:Prodloužení záruky při koupi; Délka servisní služby (v letech):3; Typ záruční  opravy:V servise","1","&lt;div class='tpl-product-detail-desc'&gt;  &lt;div class='box-in'&gt;  &lt;div class='row'&gt;  &lt;div class='desc'&gt;  &lt;h2&gt;Informace o doručení zakoupeného HP Care Pack&lt;/h2&gt;  &lt;p style='text-align: justify;'&gt;Vážení zákazníci, prosím zohledněte skutečnost, že administrativní zpracování a následné zaslání aktivačního linku může trvat na straně HP Inc až tři pracovní dny od data fakturace HP Care Pack.&lt;/p&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;div class='row'&gt;  &lt;figure class='box-img'&gt;&lt;img src='https://c.edsystem.cz/IMGCACHE/_1604/1604267_6a.jpg' alt='Obr. HP Care Pack - Oprava u zákazníka do tří pracovních dní, 3 roky 1604267a' /&gt;&lt;/figure&gt;  &lt;div class='desc'&gt;  &lt;h2&gt;HP Care Pack - Oprava u zákazníka do tří pracovních dní, 3 roky&lt;/h2&gt;  &lt;p style='text-align: justify;'&gt;HP Care Pack nabízí vysokou úroveň služeb s cílem maximalizovat přínos Vašich investic do HP produktů s pomocí snadno zakoupitelných a uživatelsky přístupných balíčků podpůrných služeb. Volba úrovně poskytované podpory (od desktopů a notebooků až po podporu serverů a storage systémů). Záleží pouze na konkrétních potřebách Vašeho podniku či domácnosti. Tyto služby také výrazně ovlivňují návratnost Vašich investic vložených do hardwarových zařízení. Dají se pořídit na celé portfolio produktů značky HP.&lt;/p&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;div class='row tech-params'&gt;  &lt;div class='desc'&gt;  &lt;h2&gt;Technická specifikace&lt;/h2&gt;  &lt;ul&gt;  &lt;li&gt;HP Care Pack rozšiřuje záruku na 3 roky s opravou přímo u vás.&lt;/li&gt;  &lt;li&gt;HP Care Pack typu 3 business day response - Odezva do tří pracovních dní s opravou u zákazník po telefonické domluvě.&lt;/li&gt;  &lt;li&gt;Určeno pro vybrané notebooky HP Spectre, OMEN&lt;/li&gt;  &lt;li&gt;Název produktu: 3letá služba HP u zákazníka pro notebooky (do 3 dnů / 2letá záruka)&lt;/li&gt;  &lt;li&gt;Doba pokrytí (v měsících): 36&lt;/li&gt;  &lt;/ul&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;div class='row'&gt;  &lt;div class='desc'&gt;  &lt;h2&gt;Vyberte správný Care Pack pro Vaše zařízení&lt;/h2&gt;  &lt;p&gt;Pro ověření kompatibility HP Care Pack s Vašim zařízením, prosím, přejděte na: &lt;a href='https://cpc.ext.hp.com/portal/site/cpc/' target='_blank'&gt;HP Care Pack Central&lt;/a&gt;&lt;/p&gt;  &lt;p&gt;Do pole 'Najít produkt' vložte Part No. Vašeho zařázení bez lokace (př. 53L90EA).&lt;/p&gt;  &lt;p&gt;V horní části vyberte v roletce 'Zadejte zemi/oblast' zemi (CZ či SK).&lt;/p&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;div class='row'&gt;  &lt;div class='desc'&gt;  &lt;h2&gt;Vyskytl se nějaký problém při registraci?&lt;/h2&gt;  &lt;p&gt;Pokud máte jakýkoliv problém s registrací zakoupeného HP Care Pack, kontujte, prosím, přimárně HP Care Pack Team na emailové adrese &lt;a href='mailto:carepackcz@hp.com'&gt;carepackcz@hp.com&lt;/a&gt; (platí pro Českou republiku) nebo &lt;a href='mailto:slovakia.carepack@hp.com'&gt;slovakia.carepack@hp.com&lt;/a&gt; (platí pro Slovesnkou republiku).&lt;/p&gt;  &lt;p&gt;V záložce 'Ke stažení' na této produktové kartě je vložen soubor s nejčastěji se vyskytovanými chybami při registraci HP Care Pack, případně při práci v HP CSN systému.&lt;/p&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;div class='row'&gt;  &lt;div class='desc'&gt;  &lt;h2&gt;Doba trvání a pravidla pořizování služeb HP Care Pack&lt;/h2&gt;  &lt;p&gt;Balíček HP Care Pack rozšiřující záruku lze přikoupit do 90 dnů od data nákupu produktu.&lt;br /&gt; Balíček HP Care Pack je nutné do 10 dnů od zakoupení zaregistrovat, abyste mohli využívat jeho výhod.&lt;br /&gt; Služba začíná platit datem nákupu HW a trvá po dobu specifickou v dokumentech HP Care Pack.&lt;br /&gt; Vyzvednutí e-carepacku vyžaduje přístup do HP Channel Services Network systému (CSN).&lt;br /&gt; HP CSN systém je bezpečná internetová aplikace vytvořená pro distributory a partnery k objednávání, registraci a sledování HP Care Packů dodávaných v elektronické podobě.&lt;br /&gt; V době nákupu HW nelze nakupovat ani registrovat službu HP Care Pack současně s Post Warranty a nebo samotnou službu Post Warranty.&lt;/p&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;/div&gt;","false","0","0001004600040002","1776","-1","true","00020099","4198","-1","true","0","Měsíc(ů)","MN","0001-01-01T00:00:00","2288.00","KS","0.00","1","2021-11-01T12:37:42.033","HPC","127","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1604\/1604267_0a_3.jpg'}","        <productnavigatordata>          <attributecode>136</attributecode>          <valuecode>616</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1